Place.create([
  { :city_id => 1, :name => "revolution brewing", :address => "2323 n. milwaukee ave. chicago, il 60647", :url => "www.revbrew.com", :neighborhood => "logan square", :created_at => "2013-05-21 01:57:44", :updated_at => "2013-06-01 23:54:23", :category_id => 2, :description => "Revolution Brewing is Chicago's new hometown craft brewery. Our brewpub in Logan Square is a bustling, neighborhood institution where friends and families meet to enjoy the freshest beer in town. Opening our brewery has been a labor of love. We think you can see that in everything we do ranging from the details of our carved fists holding up our mahogany bar to the pungent hop aroma of our Anti-Hero IPA to our creative dishes like our bacon-fat popcorn.", :photo_file_name => "MugClub.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 104214, :photo_updated_at => "2013-06-01 23:54:23" },
  { :city_id => 1, :name => "longman & eagle", :address => "2657 n kedzie ave  chicago, il 60647", :url => "www.longmanandeagle.com", :neighborhood => "logan square", :created_at => "2013-05-21 02:00:39", :updated_at => "2013-06-02 00:05:00", :category_id => 2, :description => "Longman & Eagle chef Jared Wentworth uses traditional cooking techniques when executing his regional American fare, with emphasis on sourcing the finest local ingredients the region has to offer. This farm to table, nose to tail aesthetic is represented lovingly by ever-changing menus that are both adventurous and sublime, featuring items that exemplify his passion for creative, flavorful and honest dishes offered at fair and reasonable prices.", :photo_file_name => "longman.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 196544, :photo_updated_at => "2013-06-02 00:05:00" },
  { :city_id => 1, :name => "telegraph", :address => "2601 n milwaukee ave, chicago 60647", :url => "www.telegraphchicago.com", :neighborhood => "logan square", :created_at => "2013-05-21 02:01:20", :updated_at => "2013-06-01 23:55:42", :category_id => 2, :description => "Located in the heart of Logan Square, Telegraph is Chicago’s natural wine bar. Our focus is pairing a unique, often rare, European wines, curated by sommelier Jeremy Quinn, with seasonal, inventive cuisine crafted by chef Johnny Anderes.", :photo_file_name => "sign-web.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 461794, :photo_updated_at => "2013-06-01 23:55:42" },
  { :city_id => 1, :name => "yusho", :address => "2853 n kedzie ave., chicago il", :url => "yusho-chicago.com", :neighborhood => "avondale", :created_at => "2013-05-21 02:02:01", :updated_at => "2013-06-02 00:06:46", :category_id => 2, :description => "Street food is the great equalizer—no glamour required. Yakitori, when well-executed, is about the simple flavors of authentic street food. A hot grill provides intense flavors from seasonal proteins and vegetables, grilled to order over a chattering, hissing fire.\r\n\r\nBeer, wine and sake selections compliment the fresh-grilled flavors. Craft cocktails, wines and spirits are chosen for customized meal pairings. Experiment and discover!", :photo_file_name => "2x-fried-chicken.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 144522, :photo_updated_at => "2013-06-02 00:06:46" },
  { :city_id => 1, :name => "lula cafe", :address => "2537 n kedzie blvd, chicago, il 60647", :url => "lulacafe.com", :neighborhood => "logan square", :created_at => "2013-05-22 19:59:43", :updated_at => "2013-06-02 00:02:40", :category_id => 2, :description => "On September 2, 1999, Lula Cafe opened in a small storefront on Kedzie Boulevard with a four burner home stove and a dented batterie of thrifted pots and pans. Today, stretching three storefronts, it is the founding member of the nationally recognized Logan Square culinary community and a celebrated forerunner of the ‘farm to table’ movement in Chicago.\r\n\r\nWith self taught chefs and a willingness to cook against categorization, the menu at Lula has grown into a kind of humble maturity, risky but grounded, a boheme bistro of the unclassifiable kind. We want you to come for all occasions, to read a book at the bar with a glass of wine, to celebrate birthdays and first dates, to taste through the seasons, to brunch with friends after a night out. Anything is possible, welcomed, wished for, here at Lula.", :photo_file_name => "food_5.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 63966, :photo_updated_at => "2013-06-02 00:02:39" },
  { :city_id => 4, :name => "slanted door", :address => "1 ferry building #3 san francisco, ca 94111", :url => "www.slanteddoor.com", :neighborhood => "downtown", :created_at => "2013-05-28 21:10:36", :updated_at => "2013-06-02 00:09:21", :category_id => 2, :description => "For every item on our menu, Executive Chef, Charles Phan goes to the original source region of that item. He studies the traditional ingredients, flavors and techniques, then retreats to his Mission district test kitchen, where he and his team recreate the original using contemporary methods and the finest and freshest local ingredients. The finished product is a faithful reproduction of a world classic, modernized in subtle yet powerful ways.", :photo_file_name => "l.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 60709, :photo_updated_at => "2013-06-02 00:09:20" },
