Review.create([
  { :category => "", :place_id => 1, :review_text => "I love this place. The burgers are fantastic and there is always a rotating selection of beers that are top notch.", :review_date => "2013-05-22", :user_id => 16, :created_at => "2013-05-22 19:01:35", :updated_at => "2013-05-22 19:01:35" },
  { :category => "", :place_id => 4, :review_text => "This is probably my favorite restaurant in the city right now. The concept is Japanese street food. The dishes are original and unusual and the execution is fantastic. Their cocktail program is great.\r\n\r\nA definite 'do not miss'!", :review_date => "2013-05-22", :user_id => 16, :created_at => "2013-05-22 19:02:11", :updated_at => "2013-05-22 19:02:11" },
  { :category => "", :place_id => 3, :review_text => "Great place to go when you're looking for good food and good wine. The food is a mix of small plates and typical entrees. They also really know their wines and the staff is always ready to suggest a great pairing with your meal.\r\n\r\nTheir chicken dish, which always changes, is always fantastic!", :review_date => "2013-05-22", :user_id => 14, :created_at => "2013-05-22 19:03:26", :updated_at => "2013-05-22 19:03:26" },
  { :category => "", :place_id => 2, :review_text => "The sausage shop around back has good stuff.", :review_date => "2013-05-22", :user_id => 15, :created_at => "2013-05-22 19:13:55", :updated_at => "2013-05-22 19:13:55" },
  { :category => "", :place_id => 4, :review_text => "The Miyataki mushrooms are one of my favorite dishes of all time!", :review_date => "2013-05-28", :user_id => 15, :created_at => "2013-05-28 17:17:12", :updated_at => "2013-05-28 17:17:12" },
  { :category => "", :place_id => 1, :review_text => "Come for the food, stay for the beer", :review_date => "2013-05-28", :user_id => 14, :created_at => "2013-05-28 17:23:11", :updated_at => "2013-05-28 17:24:08" },
  { :category => "", :place_id => 9, :review_text => "Food, wine and service is fantastic!  Food changes seasonally and is delish...they are kid friendly as well when dining on the early side!", :review_date => "2013-06-01", :user_id => 16, :created_at => "2013-06-01 22:21:46", :updated_at => "2013-06-01 22:21:46" },
  { :category => "", :place_id => 10, :review_text => "So many fun events in Oz Park but one of my favorites is \"movies in the park\"!  Check their calendar for when and pack your picnic bag...enjoy.", :review_date => "2013-06-01", :user_id => 17, :created_at => "2013-06-01 22:22:25", :updated_at => "2013-06-01 22:22:25" },
  { :category => "", :place_id => 11, :review_text => "Try their daily specials, they use  fresh produce from the local farmers market and the dishes are never a disappointment...same with their daily wine special selections!  friendly neighborhood atmosphere...love it!", :review_date => "2013-06-01", :user_id => 19, :created_at => "2013-06-01 22:23:10", :updated_at => "2013-06-01 22:23:10" },
  { :category => "", :place_id => 1, :review_text => "bar\r\n", :review_date => "2013-06-02", :user_id => 14, :created_at => "2013-06-02 19:32:51", :updated_at => "2013-06-02 19:32:51" },
  { :category => "", :place_id => 11, :review_text => "Try their daily specials, they use fresh produce from the local farmers market and the dishes are never a disappointment...same with their daily wine special selections! friendly neighborhood atmosphere...love it!", :review_date => "2013-06-04", :user_id => 17, :created_at => "2013-06-04 00:58:40", :updated_at => "2013-06-04 00:58:40" },
  { :category => "", :place_id => 13, :review_text => "This without a doubt has been one of the best additions to our neighborhood!! Food, atmosphere and service is fantastic...indoors + out.", :review_date => "2013-06-04", :user_id => 17, :created_at => "2013-06-04 00:59:00", :updated_at => "2013-06-04 00:59:00" }
